import React from 'react'
import AuthenticationService from './AuthenticationService.js'
function UpdateBalance() {
    const user = AuthenticationService.getLoggedInUserName();
    console.log(user);
    return (
        <div>
            <div>{user}</div>
        </div>
    )
}

export default UpdateBalance
